import React from 'react';
import axios from 'axios';

function EliminarRiesgo({ id, onRiesgoEliminado }) {
  const handleEliminar = () => {
    axios.delete(`/api/riesgos/${id}`)
      .then(response => {
        console.log(response.data.mensaje);
        onRiesgoEliminado(id);
      })
      .catch(error => {
        console.error(error);
      });
  };

  return (
    <button onClick={handleEliminar}>Eliminar Riesgo</button>
  );
}

export default EliminarRiesgo;
